INSERT INTO `presentation` (`id`, `titre`, `image_slide1`, `image_slide2`, `image_slide3`, `image_slide4`, `image_slide5`, `titre_introduction`, `introduction`, `titre_texte1`, `texte_1`, `titre_texte2`, `texte_2`, `titre_texte3`, `texte_3`) VALUES
(1, '', '', '', '', '', '', '', '', '', '', '', '', '', ''),
(2, 'Nicolas DESVENAIN', 'https://zupimages.net/up/22/40/2u81.jpg', 'https://zupimages.net/up/22/40/v1fj.jpg', 'https://zupimages.net/up/22/40/yjoq.jpg', 'https://zupimages.net/up/22/39/qp67.jpg', 'https://zupimages.net/up/22/39/qp67.jpg', 'Titre de l\'introduction', 'Tombé dans la marmite occitane dès son enfance, Nicolas DESVENAIN aime raconter l\'histoire de chaque instrument, dans le moindre détail,\r\nla fabrication de ces magnifiques répliques par des artistes luthiers renommés de Toulouse, de Carcassonne et de Corse :\r\nl\'organistrum, la cornemuse polyphonique du XIIIe siècle, les percussions en peau de chèvre tendue, le carillon du roi David,\r\nl\'orgue portatif, la flûte traversière en roseau, la vièle à archet, les instruments savants et raffinés comme le rebec (en langue arabe le « rabab »),\r\nle luth, la guitare sarrasine, sans oublier, entre beaucoup d\'autres, la guimbarde des comtes de Toulouse.', 'Un titre_1', 'Il se penche à l\'orée des années 2000 sur l\'histoire du chant trobar, se documente et apprend à lire les enluminures médiévales.\r\nSon acharnement finit par payer. En 2003, l\'Ariégeois est repéré par le groupe Oc\' et accompagne en concert la formation corse I Muvrini.\r\nOutre cette aventure, il crée la même année La Rosa Trobadoresca.', 'Un titre_2', 'Une aventure qui lui permet de faire revivre cet amour platonique, ce fameux patois du XIIe siècle. Une passion qu\'il a même pu\r\ntransmettre aux Américains, puisqu\'il intervient ponctuellement dans tous les États-Unis pour partager ses connaissances de l\'art Trobar.\r\nSon envie d\'apprendre ne s\'arrête pas là, puisqu\'il a eu la chance d\'être initié à l\'art de la lutherie, qu\'il exerce à présent professionnellement.', 'Un titre_3', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).');

